import './styles.css';

function Navbar() {
  return (
    <nav className="navbar">
      <div className="navbar-logo">Review Roam</div>
      <div className="navbar-items">
        <a href="/">Home</a>
        <a href="/">Businesses</a>
        <a href="/">Services</a>
        <a href="/">Contact</a>
      </div>
    </nav>
  );
}

export default Navbar;
